            method:'POST',
            body:{myproduct}
        });
        let pro = await prod.json();
    }
    return (<div>
{props.products.map((myproduct)=>{<div key={myproduct}>
   <h1>{myproduct.name}</h1> 
   <p>{myproduct.description}</p>
   <button onClick={()=>{buymyproduct(myproduct);}}>ADD TO SHOPING CART</button>
</div>
}
)}
    </div>);
}
